import 'bootstrap/dist/css/bootstrap.min.css';
import { React } from 'react';
//import './App.css'
import { Routes, Route } from "react-router-dom";
//import MyNavbar from './omsOrderComponent/MyNavbar';
import Test from './test/Test';
import Test2 from './test/Test2';
import Creat from './test/Creat'; 
 import ReadOrderDetails from'./omsOrderComponent/ReadOrderDetails'
 import SmallExample from'./omsOrderComponent/SmallExample'
 import GridExample from'./omsOrderComponent/GridExample'

function App() {
  return (
    <div >
      <GridExample />
      <Routes>
        <Route></Route>
        <Route exact path="/r" element={<ReadOrderDetails />} />
        <Route exact path="/t" element={<Test />} />
        <Route exact path="/c" element={<Creat />} />
        <Route exact path="/t2" element={<Test2 />} />
        <Route exact path="/tb" element={<SmallExample />} />
      </Routes>
    </div>
  );
}
export default App;
